import imageRick from './img/rick-morty.png';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <h1 className="title">Rick & Morty</h1>
        <img src={imageRick} alt="Rick & Morty" className="img-home"/>
        <button onclick = {()=> 0} className="btn-search"></button>
      </header>
    </div>
  );
}

export default App;
